#import time
class Solution:
    def shortestBridge(self, A):
        #time1=time.time()
        n=len(A)
        if n==1:
            return 0
        isvisited=[[0 for i in range(n)]for j in range(n)]
        islands,stack1={'islanda':[],'islandb':[]},[]
        isvisited[0][0]=1
        flag=0
        for i in range(n):
            if flag==0:
                for j in range(n):
                    isvisited[i][j]=1
                    if A[i][j]==1:
                        ii,jj=i,j
                        flag=1
                        break
            else:
                break
        stack1.append((ii, jj))
        A[ii][jj]=2
        while stack1:
            temp = stack1.pop()
            i, j = temp[0], temp[1]
            if i - 1 >= 0 and isvisited[i - 1][j] == 0:
                isvisited[i - 1][j] = 1
                if A[i - 1][j] == 1:
                    A[i-1][j] = 2
                    stack1.append((i - 1, j))
            if i + 1 < n and isvisited[i + 1][j] == 0:
                isvisited[i + 1][j] = 1
                if A[i + 1][j] == 1:
                    A[i+1][j] = 2
                    stack1.append((i + 1, j))
            if j - 1 >= 0 and isvisited[i][j - 1] == 0:
                isvisited[i][j - 1] = 1
                if A[i][j - 1] == 1:
                    A[i][j-1] = 2
                    stack1.append((i, j - 1))
            if j + 1 < n and isvisited[i][j + 1] == 0:
                isvisited[i][j + 1] = 1
                if A[i][j + 1] == 1:
                    A[i][j+1] = 2
                    stack1.append((i, j + 1))
        for i in range(n):
            for j in range(n):
                if (i-1>=0 and A[i-1][j]==0) or (i+1<n and A[i+1][j]==0) or (j-1>=0 and A[i][j-1]==0) or (j+1<n and A[i][j+1]==0):
                    if A[i][j]==1:
                        islands['islandb'].append((i,j))
                    elif A[i][j]==2:
                        islands['islanda'].append((i,j))
        #time2=time.time()
        #print(time2-time1)
        res=2*n
        #print(len(islands['islanda']))
        #print(len(islands['islandb']))
        for itema in islands['islanda']:
            for itemb in islands['islandb']:
                res=min(res,abs(itema[0]-itemb[0])+abs(itema[1]-itemb[1])-1)
        #time3 = time.time()
        #print(time3 - time2)
        return res
"""
分为两步，先找到两个岛，然后找最短距离
1 首先设两个岛的点数分别为n,m  主要的时间花在了寻找最短距离上
因此不能对岛遍历而是应该对岛的边缘遍历
把岛A用2标记，岛B用1标记
通过寻找是否边上有0来判断是不是边缘
最后对边缘遍历找最短路径
"""
