                    if (i > 0 and A[i-1][j] == 0) or(j > 0 and A[i][j-1] == 0) or(i<len(A) - 1 and A[i+1][j] == 0) or(j < len(A[0]) - 1 and A[i][j + 1] == 0):
                        m[A[i][j]].append((i, j))
